import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Welcome_page from "./windows/welcom_page";

function App() {
  return (
      <Router>
        <Routes>
          <Route exact path='/' >
            <Welcome_page/>
          </Route>
          <Route path='/login' component={<Welcome_page/>}/>
        </Routes>
      </Router>
  );
}

export default App;
